import { Grid } from "@material-ui/core";

export default function OrderItem({ items }) {
  return items?.length
    ? items.map((item) => (
        <Grid container spacing={1}>
          <Grid item xs={4}>
            <img
              src={
                product.image
                  ? item.product.image.publicUrl
                  : item.product.images[0].file.publicUrl
              }
            />
          </Grid>
          <Grid item xs={8}></Grid>
        </Grid>
      ))
    : "...";
}
